(1, 'vgnehr-eizvqx-zagwsm-abqdmi-gmtyxs', 1, 'Welcome To Email Subscribers', '<strong style="color: #990000">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters & automatically notify subscribers about new blog posts once it is published. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style="color: #990000">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br>Admin', 2, 'Sent', '2020-04-13 16:20:30', '2020-04-13 16:20:34', NULL, '2020-04-13 16:20:30', '2020-04-13 16:20:30'),
(2, 'tdlzpw-trobnz-aqyout-igwrxe-opvlmi', 2, 'New Post Published - ¡Hola, mundo!', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : ¡Hola, mundo!</p>\n<p>You can view it from this link : <a href=\'http://dev.darknk.com/2020/04/10/hola-mundo/\' target=\'_blank\'>http://dev.darknk.com/2020/04/10/hola-mundo/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 2, 'Sent', '2020-04-13 16:20:35', '2020-04-13 16:20:37', NULL, '2020-04-13 16:20:35', '2020-04-13 16:20:35'),
(3, 'gbelrs-bfydiu-rwzpqc-rsvokw-tkaxgc', 2, 'New Post Published - EL DISEÑO MINIMALISTA DE PRODUCTOS Y SUS MATICES ENCANTADORES.', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : EL DISEÑO MINIMALISTA DE PRODUCTOS Y SUS MATICES ENCANTADORES.<br />\n<a href=\'http://dev.darknk.com/2020/04/18/el-diseno-minimalista-de-productos-y-sus-matices-encantadores/\' target=\'_blank\'><img width="150" height="150" src="http://dev.darknk.com/wp-content/uploads/2020/04/Slide-Show-1-150x150.jpg" class="attachment-thumbnail size-thumbnail wp-post-image" alt="" /></a></p>\n<p>You can view it from this link : <a href=\'http://dev.darknk.com/2020/04/18/el-diseno-minimalista-de-productos-y-sus-matices-encantadores/\' target=\'_blank\'>http://dev.darknk.com/2020/04/18/el-diseno-minimalista-de-productos-y-sus-matices-encantadores/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 2, 'Sent', '2020-04-18 23:40:18', '2020-04-18 23:40:21', 'a:2:{s:7:"post_id";i:50467;s:4:"type";s:17:"post_notification";}', '2020-04-18 23:32:23', '2020-04-18 23:32:23') ;

